import TabPanel from './TabPanel';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Myra Dotzel
        </p>
        <div variant="fullWidth">
          <TabPanel></TabPanel>
        </div>
      </header>
    </div>
  );
}

export default App;
